could you help me with that task??<br>- i am a beginner .<br>the task:<br>If you useHTML collection of all your sections getting them with their tag name like:
<br>const sections = Array.from(document.getElementsByTagName(&quot;section&quot;));
<br>Then you can iterate over this array and generate separate &lt;li&gt; elements.
<br>for(section of sections){
<br>  const listItem = document.createElement(&#39;li&#39;);
<br>  navList.appendChild(listItem);
<br>}
<br>This will make your code more dynamic as when you add any new section in the index.html document, it will generate a new navigation item dynamically.

Update as for 3 Nov 2023 (router and architectural level address). And thanks Tim for teaching us this top notch lessons &lt;3:<br><br>1. Update package<br>npm uninstall react-router-dom
<br>npm install react-router-dom@6.18.0<br><br>2. Router in App.js instead of HomePage.js. This ensures that only the corresponding component is displayed for each route, and the routing is handled at the App level. <br><br>Some changes for newer packages are &quot;Switch&quot; to &quot;Routes&quot; and &quot;components&quot; to &quot;elements&quot;. Code:<br><br>// For App.js<br>import React, { Component } from &quot;react&quot;;
<br>import { render } from &quot;react-dom&quot;;
<br>import { BrowserRouter as Router, Routes, Route, Link, Redirect } from &quot;react-router-dom&quot;;
<br>import HomePage from &quot;./HomePage&quot;;
<br>import RoomJoinPage from &quot;./RoomJoinPage&quot;;
<br>import CreateRoomPage from &quot;./CreateRoomPage&quot;;
<br>
<br>export default class App extends Component {
<br>    render() {
<br>        return (
<br>            &lt;Router&gt;
<br>                &lt;Routes&gt;
<br>                    &lt;Route path=&quot;/&quot; element={&lt;HomePage /&gt;} index /&gt;
<br>                    &lt;Route path=&quot;/join&quot; element={&lt;RoomJoinPage /&gt;} /&gt;
<br>                    &lt;Route path=&quot;/create&quot; element={&lt;CreateRoomPage /&gt;} /&gt;
<br>                &lt;/Routes&gt;
<br>            &lt;/Router&gt;
<br>        );
<br>    }
<br>}
<br>
<br>const appDiv = document.getElementById(&quot;app&quot;);
<br>render(&lt;App /&gt;, appDiv);
<br><br>// For HomePage.js:<br>import React, { Component } from &quot;react&quot;;
<br>
<br>export default class HomePage extends Component {
<br>    constructor(props) {
<br>        super(props);
<br>    }
<br>
<br>    render() {
<br>        return &lt;p&gt;This is the homepage&lt;/p&gt;
<br>    }
<br>}<br><br>// For CreateRoomPage.js:<br>import React, { Component } from &quot;react&quot;;
<br>
<br>export default class CreateRoomPage extends Component {
<br>    constructor(props) {
<br>        super(props);
<br>    }
<br>
<br>    render() {
<br>        return &lt;p&gt;This is the create room page&lt;/p&gt;
<br>    }
<br>}<br><br>// For RoomJoinPage.js:<br>import React, { Component } from &quot;react&quot;;
<br>
<br>export default class RoomJoinPage extends Component {
<br>    constructor(props) {
<br>        super(props);
<br>    }
<br>
<br>    render() {
<br>        return &lt;p&gt;This is the room join page&lt;/p&gt;
<br>    }
<br>}

Hey, great tutorial! For those using react-router-dom v6, the API has changed a bit. Took me quite a bit to nail it down lol.<br><br>1. The switch has been replaced with Routes.
<br>2. Components for routes are now passed through the element prop.
<br>3. The exact prop is no longer needed as routes match exactly by default in v6.<br><br>Here&#39;s how you&#39;d update the code:
<br>
<br>import React, { Component } from &quot;react&quot;;
<br>import RoomJoinPage from &quot;./RoomJoinPage&quot;;
<br>import CreateRoomPage from &quot;./CreateRoomPage&quot;;
<br>import { BrowserRouter as Router, Routes, Route } from &quot;react-router-dom&quot;;
<br>
<br>export default class HomePage extends Component {
<br>  constructor(props) {
<br>    super(props);
<br>  }
<br>
<br>  render() {
<br>    return (
<br>      &lt;Router&gt;
<br>        &lt;Routes&gt;
<br>          &lt;Route path=&quot;/&quot; element={&lt;p&gt;This is the home page&lt;/p&gt;} /&gt;
<br>          &lt;Route path=&quot;/join&quot; element={&lt;RoomJoinPage /&gt;} /&gt;
<br>          &lt;Route path=&quot;/create&quot; element={&lt;CreateRoomPage /&gt;} /&gt;
<br>        &lt;/Routes&gt;
<br>      &lt;/Router&gt;
<br>    );
<br>  }
<br>}<br>
<br>Hope this helps! üëç

Writing in 2023.<br>If Router  is not showing components, try this.<br>&lt;Router&gt;
<br>                &lt;Routes&gt;
<br>                    &lt;Route exact path=&#39;/&#39; element={&lt;p&gt;This is the home page&lt;/p&gt;} /&gt;
<br>                    &lt;Route exact path=&#39;/join&#39; element={&lt;RoomJoinPage /&gt;} /&gt;
<br>                    &lt;Route exact path=&#39;/create&#39; element={&lt;CreateRoomPage/&gt;} /&gt;
<br>                &lt;/Routes&gt;
<br> &lt;/Router&gt;

